import React from 'react';
import {Link, Outlet} from 'react-router-dom';
import logo from '../logo192.png';
import './Welcome.css';

const Welcome = () => {
    return (
        <div class="div">
            <img src={logo} alt="Logo" class="image"></img>
            <br/>
                <Link to="/register">
                    <button type="button" class="button1">Register</button>
                </Link>
            <Outlet />
        </div>
    )
};

export default Welcome;
